function Prime(num) {
  if (typeof num !== 'number' || isNaN(num)) {
    return false;
  }
  if (num <= 1) {
      return false;
  }
  const letzteZiffer = num % 10;
  if (num > 10 && ![1, 3, 7, 9].includes(letzteZiffer)) {
      return false; 
  }
  if ([2, 3, 5].includes(num)) {
      return true;
  }
  if (num % 2 === 0 || num % 3 === 0 || num % 5 === 0) {
    return false;
  }
  for (let i = 7; i * i <= num; i += 2) {
      if (num % i === 0) {
          return false;
      }
  }
  return true;
}


(function (Scratch) {
    "use strict";
    if (!Scratch.extensions.unsandboxed) throw new Error("Prim Utilities must run unsandboxed");
    const menuIconURI = "data:image/svg+xml;base64,";
    class MJPUPrimeU {
      getInfo() {
        return {
          id: "MJPUPrimeU",
          name: "Prim Utilities",
          color1: "#31acbd",
          color2: "#37c1d4",
          color3: "#40e0f5",
          menuIconURI,
          blocks: [
            {
              opcode: "isPrime",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.BOOLEAN,
              text: "is [NUM] prime?",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 1 }
              }
            },
            {
              opcode: "FirstPrimeBetween",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "first prime between [NUM] and [NUM2]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 1 },
                NUM2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 }
              }
            },
            {
              opcode: "RandomPrimeBetween",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "random prime between [NUM] and [NUM2]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 1 },
                NUM2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 }
              }
            },
            {
              opcode: "AllPrimeBetween",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "all primes between [NUM] and [NUM2]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 1 },
                NUM2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 }
              }
            },
            {
              opcode: "PrimeAmountBetween",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "number of primes between [NUM] and [NUM2]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 1 },
                NUM2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              }
            },
            {
              opcode: "SPrimeHigherT",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "smallest prime higher than [NUM]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 2 },
              }
            },
            {
              opcode: "HPrimeSmallerT",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "highest prime smaller than [NUM]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              }
            },
            { blockType: Scratch.BlockType.LABEL, text: "Number decomposition" },
            {
              opcode: "DivisorSet",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "divisor set of [NUM]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              }
            },
            {
              opcode: "PFZ",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "Prime factor decomposition of [NUM]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              }
            },
            { blockType: Scratch.BlockType.LABEL, text: "Special Prime Functions" },
            {
              opcode: "GoldbackPairs",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "Goldbach pairs for [NUM]",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              } 
            },
            {
              opcode: "PrimeTwins",
              extensions: ["colours_operators"],
              blockType: Scratch.BlockType.REPORTER,
              text: "prime twins between [NUM] and [NUM2] ",
              arguments: {
                NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 2 },
                NUM2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 15 },
              } 
            }
          ],
          
        };
      }
    
      isPrime(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        return Prime(num)
      }
      FirstPrimeBetween(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const num2 = Math.abs(Scratch.Cast.toNumber(args.NUM2));
        const start = Math.min(num, num2);
        const end = Math.max(num, num2);
        for (let i = start; i <= end; i++) {
            if (Prime(i)) {
                return i; 
            }
        }
        return 2; 
      }
      RandomPrimeBetween(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const num2 = Math.abs(Scratch.Cast.toNumber(args.NUM2));
        const start = Math.min(num, num2);
        const end = Math.max(num, num2);
        const primes = [];
        for (let i = start; i <= end; i++) {
            if (Prime(i)) {
                primes.push(i);
            }
        } 
        if (primes.length === 0) {
            return 2; 
        }
        const randomIndex = Math.floor(Math.random() * primes.length);
        return primes[randomIndex];
      }
      AllPrimeBetween(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const num2 = Math.abs(Scratch.Cast.toNumber(args.NUM2));
        const start = Math.min(num, num2);
        const end = Math.max(num, num2);
        const primes = [];
        for (let i = start; i <= end; i++) {
            if (Prime(i)) {
                primes.push(i);
            }
        } 
        if (primes.length === 0) {
            return 2; 
        }
        return primes.join(', ');
      }
      PFZ(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const factors = [];
        let n = num;
        if (n <= 1) return '';
        while (n % 2 === 0) {
            factors.push(2);
            n /= 2;
        }
        for (let i = 3; i <= Math.sqrt(n); i += 2) {
            while (n % i === 0) {
                factors.push(i);
                n /= i;
            }
        }
        if (n > 2) {
            factors.push(n);
        }
        return factors.join(', ');
      }
      SPrimeHigherT(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        let i = num + 1; 
        while (true) {
            if (Prime(i)) {
                return i; 
            }
            i++;
        }
      }
      HPrimeSmallerT(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        for (let i = num; i >= 2; i--) {
          if (Prime(i)) {
              return i; 
            }
        }
        return 2;
      }
      PrimeAmountBetween(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const num2 = Math.abs(Scratch.Cast.toNumber(args.NUM2));
        const start = Math.min(num, num2);
        const end = Math.max(num, num2);
        let primeCount = 0;
        for (let i = start; i <= end; i++) {
          if (Prime(i)) {
              primeCount++;
          }
        } 
        return primeCount;
      }
      DivisorSet(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const divisors = [];
      
        for (let i = 1; i <= num; i++) {
            if (num % i === 0) {
                divisors.push(i);
            }
        }
    
        return divisors.join(", ");
      }
      GoldbackPairs(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const primes = [];
        const pairs = [];
    
        for (let i = 2; i <= num; i++) {
            let isPrime = true;
            for (let j = 2; j * j <= i; j++) {
                if (i % j === 0) {
                    isPrime = false;
                    break;
                }
            }
            if (isPrime) {
                primes.push(i);
            }
        }
    
        for (let i = 0; i < primes.length; i++) {
            for (let j = i; j < primes.length; j++) {
                if (primes[i] + primes[j] === num) {
                    pairs.push(`(${primes[i]}, ${primes[j]})`);
                }
            }
        }
    
        return pairs.join(", ");
      }
      PrimeTwins(args) {
        const num = Math.abs(Scratch.Cast.toNumber(args.NUM));
        const num2 = Math.abs(Scratch.Cast.toNumber(args.NUM2));
        const twins = [];
    
        for (let i = Math.min(num, num2); i <= Math.max(num, num2); i++) {
            if (Prime(i) && Prime(i + 2)) {
                twins.push(`(${i}, ${i + 2})`);
            }
        }
    
        return twins.join(", ");
      }
    }
    Scratch.extensions.register(new MJPUPrimeU());
})(Scratch);
